import { Link } from "react-router-dom";
import 'bootstrap/dist/css/bootstrap.min.css';
import '../App.css';

function Header() {
  return (
    <nav>
        <ul>
            <li>
                <Link to="/">Home</Link>
            </li>
            <li>
                <Link to="/about">About Me</Link>
            </li>
            <li>
                <Link to="/projects">Projeccts</Link>
            </li>
            <li>
            <Link to="/contact">Contact</Link>
            </li>
        </ul>
    </nav>
  );
}

export default Header;
